Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      if(Key.isDown(_root.右键) == true)
      {
         _parent.移动("右",快速度);
      }
      else
      {
         _parent.移动("右",慢速度);
      }
   }
   else if(_parent.方向 == "左")
   {
      if(Key.isDown(_root.左键) == true)
      {
         _parent.移动("左",快速度);
      }
      else
      {
         _parent.移动("左",慢速度);
      }
   }
}

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   子弹威力 = _parent._parent.空手攻击力 + _parent._parent.刀属性.power + _parent._parent.mp * (_root.等级 / 100) * (_root.等级 / 100);
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 1;
   击中后子弹的效果 = "空手攻击火花";
   击退初速度 = 12;
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   i = 1;
   while(i <= 3)
   {
      if(_parent.刀.刀.装扮["刀口位置" + i]._x != undefined)
      {
         var myPoint = {x:_parent.刀.刀.装扮["刀口位置" + i]._x,y:_parent.刀.刀.装扮["刀口位置" + i]._y};
         _parent.刀.刀.装扮.localToGlobal(myPoint);
         if(myPoint.y == _parent.刀.刀.装扮["刀口位置" + i]._y)
         {
            _parent.动画完毕();
         }
         _root.gameworld.globalToLocal(myPoint);
         shootX = myPoint.x;
         shootY = myPoint.y;
         _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果,击退初速度);
      }
      i++;
   }
}

